import React, { Component } from "react";
import Glasses from "./Glasses";
import Item from "./Item";
import styleLayout from "./Layout.module.css";

class Layout extends Component {
  render() {
    return (
      <div className={styleLayout
      }>
        <div className={styleLayout.navbar}>
          <h1 className={styleLayout.title}>Try glasses app online</h1>
        </div>
        <div className={styleLayout.item__list}>
          <div className={styleLayout.item__container}>
            <Item></Item>
            <Item></Item>
          </div>
          <Glasses></Glasses>
        </div>
      </div>
    );
  }
}

export default Layout;
